import Button from 'react-bootstrap/Button';
import Badge from 'react-bootstrap/Badge';

function AddTask() {
    return (
      <div>
        <input
          type="text"
          placeholder={"Add new task ..."}
        />
        <h1>
        Example heading <Badge bg="secondary">New</Badge>
        </h1>
      </div>
    );
  }
  
  export default AddTask;
